webpackJsonp([0xeffdd4efa87b3800],{"./node_modules/json-loader/index.js!./.cache/json/updates-brainstorming-design-ideas.json":function(e,o){e.exports={data:{markdownRemark:{html:"<p>We want to explore. We’re curious people. Look back over history, people have put their lives at stake to go out and explore … We believe in what we’re doing. Now it’s time to go.</p>\n<p>Astronomy compels the soul to look upward, and leads us from this world to another.</p>\n<p>For those who have seen the Earth from space, and for the hundreds and perhaps thousands more who will, the experience most certainly changes your perspective. The things that we share in our world are far more valuable than those which divide us.</p>\n<p>We are all connected; To each other, biologically. To the earth, chemically. To the rest of the universe atomically.</p>\n<p>Dinosaurs are extinct today because they lacked opposable thumbs and the brainpower to build a space program.</p>\n<p>Science cuts two ways, of course; its products can be used for both good and evil. But there's no turning back from science. The early warnings about technological dangers also come from science.</p>\n<p>We have an infinite amount to learn both from nature and from each other</p>\n<p>To go places and do things that have never been done before – that’s what living is all about.</p>\n<p>NASA is not about the ‘Adventure of Human Space Exploration’…We won’t be doing it just to get out there in space – we’ll be doing it because the things we learn out there will be making life better for a lot of people who won’t be able to go.</p>\n<p>We are all connected; To each other, biologically. To the earth, chemically. To the rest of the universe atomically.</p>",timeToRead:1,excerpt:"We want to explore. We’re curious people. Look back over history, people have put their lives at stake to go out and explore … We believe in...",frontmatter:{title:"Brainstorming Design Ideas",date:"2016.08.14",type:"post",category:"Design",tags:["concept","wireframe","sketch"],previous:"setting-up-our-development-environment",next:"choosing-the-right-stack"},fields:{slug:"/brainstorming-design-ideas"}}},pathContext:{slug:"/brainstorming-design-ideas"}}}});
